import React, { useContext } from 'react';
import NameGeneratorContext from "../NameGeneratorContext";
import roots from "../root_words";

const GeneratorOutput = () => {
  const { selectedWords } = useContext(NameGeneratorContext);

  return (
    <div>
      {
        Object.entries(selectedWords).map((selectedWord) => {
          const type = selectedWord[0];
          const list = selectedWord[1];

          if (list.length) {
            return (
              <>
                {
                  list.map((word) => {
                    // console.log(roots[type])
                    // console.log(roots)

                    if (roots[type]) {
                      Object.entries(roots[type]).map((wordName) => {
                        const engWord = wordName[0];
                        const translationObj = wordName[1];

                        // console.log(wordName[0])
                        // console.log(wordName[1])
                        Object.entries(translationObj).map((langWord) => {
                          // console.log(langWord[0])
                          // console.log(langWord[1])

                          return (
                            <div key={langWord[0]}>
                              {langWord[0]}

                              {
                                Object.entries(langWord[1]).map((foo) => {
                                  console.log(foo[0])
                                  console.log(foo[1])

                                  return (
                                    <div key={foo[0]}>
                                      {foo[0]}
                                      {foo[1]}
                                    </div>
                                  );
                                })
                              }
                            </div>
                          );
                        })

                        return (
                          <div key={wordName[0]}>
                            {wordName[0]}
                          </div>
                        );
                      })
                    }
                  })
                }
              </>
            );
          }
        })
      }
    </div>
  );
};

export default GeneratorOutput;
